import React from 'react';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles((theme) => ({
  title: {
    // width: '100%',
    // backgroundColor: theme.palette.background.paper,
    // height: "650px",
    // overflowY: 'scroll',
    // border: '2px solid black'
  },
  methodName: {
    color: '#504F4F',
  },
}));

export default function EduPoints() {
    const classes = useStyles();
    const eduPointsText = <ListItemText primary="EduPoints" className={classes.eduPointsText}/>;

    return (
      <div>
        <Typography variant="h1" className={classes.title}> 
            How Do EduPoints Work?            
        </Typography>
        <Typography variant="h3" className={classes.subtitle}>
        Earn EduPoints and Start Downloading Study Materials
        </Typography>

        <List>
          <ListItem>
            <ListItemIcon>

            </ListItemIcon>
            <ListItemText primary="Upload a Document" className={classes.methodName}/>
            <ListItemText primary="50" className={classes.pointsNum}/>
            {eduPointsText}
          </ListItem>
        </List>

      </div>
    );
}
